// RhumbLexerInit initializes any static state used to implement RhumbLexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// NewRhumbLexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func RhumbLexerInit() {
	staticData := &rhumblexerLexerStaticData
	staticData.once.Do(rhumblexerLexerInit)
}

// NewRhumbLexer produces a new lexer instance for the optional input antlr.CharStream.
func NewRhumbLexer(input antlr.CharStream) *RhumbLexer {
	RhumbLexerInit()
	l := new(RhumbLexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
	staticData := &rhumblexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.predictionContextCache)
	l.channelNames = staticData.channelNames
	l.modeNames = staticData.modeNames
	l.RuleNames = staticData.ruleNames
	l.LiteralNames = staticData.literalNames
	l.SymbolicNames = staticData.symbolicNames
	l.GrammarFileName = "RhumbLexer.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

